A empresa contratada será responsável por executar os seguintes serviços técnicos de sonorização:
•	Instalação, operação e acompanhamento técnico dos sistemas de som e imagem em eventos institucionais;
•	Preparação e ajuste de microfones, caixas, cabos, mesa de som, amplificadores e demais equipamentos;
•	Apoio à transmissão ao vivo das sessões, quando necessário;
•	Disponibilização de técnico capacitado com experiência comprovada na área de sonorização profissional e eventos públicos;
•	Garantia da qualidade da captação e reprodução sonora nos ambientes internos e externos.

Seguem abaixo as especificações técnicas do serviço a ser prestado:
3.2.1 - Curta Vídeo
a) Apresentacao de 52 episódios do programa Curta Vídeo, com 30 minutos de duração cada;
b) Pesquisa envolvendo a leitura de materiais informativos e a visualização de obras audiovisuais
relacionadas aos convidados que participarão de cada episódio;
c) Gravação de conteúdos promocionais (chamadas) para divulgação dos programas na grade.
3.2.2 - TV é Cinema
a) Apresentacao de 52 episódios do programa TV é Cinema, com até 120 minutos de duração cada;
b) Pesquisa, curadoria e visualização dos filmes que comporão cada sessão;
c) Montagem das sessões, sugerindo a ordem de exibição, a contextualização e a criação de uma
experiência coesa para o telespectador;
d) Redação dos textos das cabeças de apresentação;
e) Entrega dos episódios editados no formato de exibição padrão da emissora;
f) Gravação de conteúdos promocionais (chamadas) para divulgação dos programas na grade.
3.3 - Os dois programas são gravados e vão ao ar semanalmente, com reprise a ser programada em
horário oportuno.
